import React from 'react';
import "../style/leadership.css";
import EboardIcon from './EboardIcon';
import Emma from "../images/EmmaForesi.jpeg";
import Katie from "../images/KatieBailey.jpeg";
import Hari from "../images/Hari.JPG";
import Casey from "../images/Casey.jpeg";

function Leadership(){

  return (

    <div className="leadership">
        <div>
            <EboardIcon name= "Emma Foresi" image={Emma} title="Regent" linkden="https://www.linkedin.com/in/emma-foresi/" description="Our Fearless Leader"/>
        </div>
        <div>
        <EboardIcon name= "Katie Bailey" image={Katie} title="Corresponding Secretary" linkden="https://www.linkedin.com/in/katherine-m-bailey/" description="Our Fearless Leader"/>
        <EboardIcon name= "Hariharan Chidambaram" image={Hari} title="Scribe" linkden="https://www.linkedin.com/in/hariharan-chidambaram/" description="Our Fearless Leader"/>
        </div>
        <div>

        </div>


        <EboardIcon name= "Hariharan Chidambaram" image={Casey} title="Treasurer" linkden="https://www.linkedin.com/in/hariharan-chidambaram/" description="Our Fearless Leader"/>
        <EboardIcon name= "Hariharan Chidambaram" image={Hari} title="Vice-Regent" linkden="https://www.linkedin.com/in/hariharan-chidambaram/" description="Our Fearless Leader"/>
    </div>
  );
}

export default Leadership;
